import { useState, useEffect } from "react";
import Header from './assets/header/index.js';
import styled from "styled-components";
import { searchProducts as initialProducts } from './assets/search/index.js';
import SearchResult from './assets/search/results/index.js';

const AppContainer = styled.div`
  margin: 1rem 6rem 1rem 6rem;
  border: 0.4rem solid white;
  height: 100vh;
  border-radius: 2rem;
  background: linear-gradient(180deg, rgb(46 0 78) 0%, rgb(84 0 133) 100%);
  overflow: hidden;
`

function App() {
  const [products, setProducts] = useState([]);

  useEffect(() => {
    // Simulando carregamento inicial
    setProducts(initialProducts);
  }, []);

  return (

    <AppContainer>
      <Header/>
      <SearchResult results={searchProducts}>
      </SearchResult>
    </AppContainer>

  );  
}

export default App;
